import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
        <div>
            <Header/>
            <Tehnologies/>
        </div>
    );
};



const Header = () => {
    return (
        <div className="App">
            <a href={'#'}>js</a>
            <a href={'#'}>html</a>
            <a href={'#'}>react</a>
        </div>
    );
};

const Tehnologies = () => {
    return (
        <div className="App">
            <ul>
                <li>js</li>
                <li>html</li>
                <li>react</li>
            </ul>
        </div>
    );
};

export default App;
